import React from 'react'
import './Freetrial.scss'
import {useState} from 'react'
import Footer from "components/footers/MiniCenteredFooter.js";
import Header from "components/headers/light.js";

function Freetrial() {
  return (
    <div className='free'>

   <Header />
    <Footer />  
</div>
  )
}

export default Freetrial
